import React from 'react'

function Coin({name, icon, price, symbol}) {
  return (
    <>
        <div className='container'>
            <h1>{name}</h1>

            <h2>Price</h2>
            <h3>Symbol</h3>
        </div>
    </>
  )
}

export default Coin
